            <p className="advert__txt_name">Apple MacBook Air 13.6</p>
            <p className="advert__txt_description">Выгода до 10 000 ua</p>
            <button className="advert__btn">Подробнее</button>
          </div>
        </div>
        <div
          className="advert__manufacturer
"
        ></div>
      </div>
    </div>
  );
}

